import { Container, Row, Col } from "react-bootstrap";
import Imahe from '../assets/conversation.png'

function Landing() {
    return (
        <div>
            <Container>
                <div style={{display: 'flex', flexDirection: 'column', justifyContent: 'space-around'}}>
                    <div>Hello</div>
                    <Row>
                        <Col>1 of 2</Col>
                        <img src={Imahe} />
                    </Row>
                    <div>World</div>
                </div>
            </Container>
        </div>
    );
}

export default Landing;
